import React from 'react';
import axios from 'axios';


function Map(){
    return(
        <div className='mapa'>
           


        <h1> Localização Atual </h1>

        const mapboxToken = "YOUR_MAPBOX_ACCESS_TOKEN";
  const mapboxStyle = "mapbox/streets-v11";
  const latitude = 51.505;
  const longitude = -0.09;
  const zoom = 13;
  const width = 800;
  const height = 400;

  const mapImageUrl = `https://api.mapbox.com/styles/v1/${mapboxStyle}/static/${longitude},${latitude},${zoom}/${width}x${height}?access_token=${mapboxToken}`;

  return <img src={mapImageUrl} alt="Map" />;
        </div>
    )
}

export default Map
